import React from 'react';

function Card(props){
  return (
    <>
    <div className="card">
           <div className="cards">
             <img src={props.imgsrc} alt="" className="cards__img" />
              <div className="card__info">
               <span className="card__category">{props.title}</span>
               <h3 className = "card__title" >{props.stitle} </h3>
               <a href={props.link} target = "_black" >
                 <button>Watch Now</button>
               </a> 
             </div>
           </div>
         </div>
    </>
  )
}

export default Card;
